  render(){
    return <button>Click me</button>
  }
}

class MyLabel extends Component {
  render(){
    return <p>Hello World from Component</p>
  }
}

class App extends Component {
  render(){
    return(
      <div className="App">
        <h1 className="Text">Hello World</h1>,
        <h1>Ola mundo</h1>
      </div>
    )
  }
}

export default App;
